import React, { useEffect, useState } from "react";
import { useParams } from "react-router";
import { blogList } from "../../config/data.js";

const Blog = () => {
  const { id } = useParams();
  const [blog, setBlog] = useState(null);

  useEffect(() => {
    let blog = blogList.find((blog) => blog.id === parseInt(id));

    if (blog) {
      setBlog(blog);
    }
  });

  return (
    <div>
      <Link>
        <span>&#8592;</span>
      </Link>
    </div>
  );
};

export default Blog;
